import styled from '@emotion/styled';

export const Li = styled.li`
  margin-top: 20px;
  height: 20px;
  font-size: 20px;
  display: flex;
  align-items: center;
`;

export const Ul = styled.ul`
  margin-top: 20px;
  align-item: center;
  display: flex;
  flex-direction: column;
  align-items: center;
  flex-wrap: wrap;
  height: 250px;
  min-width: 320px;
  max-width: 1200px;
  margin-left: auto;
  margin-right: auto;
`;

export const P = styled.p`
  font-weight: bold;
  margin-right: 40px;
`;
